import {useRef} from "react"
import {FaBars, FaTimes} from "react-icons/fa"
import "./Styles/main.css"
function NavBar() {
    const navRef = useRef();
    return (
        <header>
            <nav ref={navRef}>
                <a href="/#">Home</a>
            </nav>
        </header>
    );
}

export default NavBar;
